import React, { Component } from 'react';
import { FormGroup, ControlLabel, FormControl, HelpBlock, Tabs,Tab}  from 'react-bootstrap';
import  DoughHydration from './../doughHydration/doughHydration';

class DisplayQuantitiesAndTimes extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.handleSelect = this.handleSelect.bind(this);

      this.state = {
        key: 1
      };
    }

    handleSelect(key) {
      alert(`selected ${key}`);
      this.setState({ key });
    }

    render() {

     const theDoughProps = this.props.doughProps;

      return (
        <div>
        <h2>Baking Time</h2>
{{theDoughProps}}
               </div>
      );
    }
  }

  export default DisplayQuantitiesAndTimes;
